import React, { FC } from "react";

type TodosProps = {
  items?: string[];
};

const Todos: FC<TodosProps> = (props) => {
  return (
    <ul>
      <li>Learn React</li>
      <li>Learn Typescript</li>
      <li>{props.children}</li>
    </ul>
  );
};

export default Todos;
